INSERT INTO `diary` VALUES (1,'Tue','오늘은 즐거운일이 많은 날이었다. 앞으로도 좋은일만 가득하면 좋겠다. 맛있는 저녁을 먹고 푹 잠에 잠드는 오늘 같은 하루.','2022-10-04',NULL,'blueCheck','평온',_binary '','sunny','2022.10.04 07:45',2,8296,1),(2,'Sun','css 왜 안되는겨..! 왜 적용안돼 왜 말안들어..! 으아아ㅏ아아아ㅏㅏ 너무 어렵다 그래도 해야쥐,,,','2022-09-25',NULL,'blueCheck','기대',_binary '','sunny','2022.10.04 08:31',1,8018,1),(3,'Sat','작은아씨들보는데 음산한 느낌,, 재밌는데 무서워 무서운데 재밌어 귀신은 안나오는거 아니까 보고 있는데,, 몰라 무서워!','2022-09-24',NULL,'blueCheck','피곤',_binary '','sunny','2022.10.05 06:41',4,697,1),(4,'Tue','아파, 아파 다쳐버린 맘이 많이 많이\noh my honey, honey, baby 어떻게 해야 하죠\n온종일 미친 듯이 놀고 와선 짙은 화장을 지우죠\n이런다고 다 잊혀질까요\n참 못나게도 반쯤 지워져 버린 두 볼에\n반쯤 지워져 버린 내 입술 위에 흘린 눈물이 클렌징크림에 녹아요\n정말 왜요, 왜요, 왜죠 언니 이 까만 밤이 새도록\n그 녀석 하나 지워내지 못하고\n왜요, 왜요, 왜죠 언니 내 검게 번진 눈물로\n못내 잊었다며 우겨대는 말 이젠 bye, bye\n나 어떡하죠, 언니 이젠 잠들고 싶은데\n내 맘은 자꾸 그 녀석한테 달려가네요\n어쩌죠, 언니 나 이대론 안 될 것만 같아\n부탁해, 딱 한잔만 나와 마셔줄래요 부탁해 언니','2022-10-04',NULL,'pinkCheck','짜증',_binary '\0','sunny','2022.10.04 09:06',1,9057,2),(7,'Wed','어제 운동을 열심히 했더니 몸에 알이 배겼다. 많이 힘들지만 몸이 개운하고 뿌듯한 시간이었다. 내일도 해야지.','2022-10-05','https://mgmg-img.s3.ap-northeast-2.amazonaws.com/23f95c34-df03-41c6-8242-80e9a3f76698-%ED%97%AC%EC%B0%BD%EB%B2%84%EC%A0%84.gif','blueCheck','기쁨',_binary '','sunny','2022.10.05 07:15',5,3213,1),(8,'Sat','세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨','2022-10-01',NULL,'pinkCheck','사랑',_binary '','sunny','2022.10.05 07:38',6,9132,1),(9,'Sun','세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨세인트모텔 콜드콜드맨','2022-10-02',NULL,'blueCheck','사랑',_binary '','sunny','2022.10.05 07:39',7,8818,1),(10,'Fri','숏폼보다가 거울 귀신영상을 봤다,, 진짜 너무 깜짝 놀랐다. 너무 무서워유ㅠㅠ 내 침대 바로 앞에 전신거울 있는데.. 잘 때 너무 무섭다 귀신이 나오면 어떡하죱..!?!!!! 꺄아아ㅏㅏ아','2022-09-02',NULL,'pinkCheck','공포',_binary '\0','rain','2022.10.05 13:45',1,2291,4),(11,'Wed','며칠째 나는 새벽에 깨어있는가,, 너무 피곤하다 아침에 일어나는거 너무 힘든데 내일 대면을 어떻게가죠.. 우울하다 우울해. 그래도 프로젝트 끝나면 푹자야지.','2022-09-07','https://mgmg-img.s3.ap-northeast-2.amazonaws.com/a6ac4a87-c61e-40f3-9d9e-fd8c5b55b0a4-%EA%B0%84.jpg','blueCheck','슬픔',_binary ''